import ContumazDestaque from '../components/destaque';
import ContumazLatest from '../components/latest';

function ContumazLatests () {
    return(
        <div id='latests'>
            <div id='latests-container'>
                <div id='latest-grid'>                    
                    <ContumazDestaque/>
                    <div>
                        <ContumazLatest/>
                        <ContumazLatest />
                        <ContumazLatest />              
                    </div>

                </div>
            </div>
            
        </div>
    );
}

export default ContumazLatests;
